Narrator

Petr and Paskal were with me too. Petr was slouching on the couch on the right side of the office and staring at the ceiling. Paskal sat across from me. He was also eagerly waiting for the results.

AddConversant(Petr Vectern); AddConversant(Paskal Beniwoll); WaitForMessage(Continue);

Narrator

Suddenly, Livia entered the room. In her hands was a large object wrapped in straw paper.

AddConversant(Livia Suno); WaitForMessage(Continue);

Narrator

As soon as she left the room, Petr came up next to me and took a look at the photograph.

RemoveConversant(Livia Suno); WaitForMessage(Continue);
